import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Auth from "./components/Auth";
import UploadEvent from "./components/UploadEvent";
import ContactUs from "./routes/ContactUs/ContactUs";
import AdminHome from "./components/AdminHome";
import Home from "./routes/Home/Home";
import Events from "./routes/Events/Events";
import PetMatching from "./routes/PetMatching/PetMatching";
import EventDetails from "./routes/EventDetails/EventDetails";
import Navbar from "./components/Navbar/Navbar"; // Adjust the import if necessary

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar /> {/* Move Navbar outside of Routes */}
        <Routes>
          <Route path="/" element={<Auth />} />
          <Route path="/upload-event" element={<UploadEvent />} />
          <Route path="/admin/*" element={<AdminHome />} />
          <Route path="/home" element={<Home />} />
          <Route path="/events" element={<Events />} />
          <Route path="/contact-us" element={<ContactUs />} />
          <Route path="/petmatching/:type" element={<PetMatching />} />
          <Route path="/eventdetails/:id" element={<EventDetails />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;

